import React from 'react';
import {Search} from './searchBook'


function Page(props: {pagenum: String, contents: String}) {
    return (
        <div className="page">
            <Search/>
            <h2 className ="contents">{props.contents}</h2>
            <h2 className ="pagenum-inpage">{props.pagenum}</h2>
        </div>
    )
}

export default Page;
